import React, { Component } from 'react';
import { Link } from 'react-router-dom';

import AuthService from '../services/AuthService';

class NavbarComponent extends Component {
    constructor(props){
        super(props)

    }

    logOut(e){
        e.preventDefault()
        AuthService.logout()
        window.location.reload()

    }
    render() {

        return (
            <div>
                <header>
                    <nav className="navbar navbar-expand-md navbar-dark bg-dark">

                    <span className='navbar-brand mb-0 h1'>Fleeting Flights</span>
                  <div className="navbar-nav flex-row">
                    <Link to={"/flights"}className='nav-link nav-left'>Flights</Link>


                   {localStorage.getItem("user")?(
                       <ul className="navbar-nav flex-row" >
                       <Link className='nav-link'to={`view-customer/${JSON.parse(localStorage.getItem("user"))[0].id}`}>Profile</Link>
                       <button className='btn btn-secondary'onClick={this.logOut}>Log Out</button>
                       </ul>
                   ):( 
                   <div className="navbar-nav">
                   <Link to={"/sign-in"} className='nav-link text-right'>Sign In</Link>
                   </div>
                   )
                   }
                    </div>
                    </nav>
                </header>
            </div>
        );
    }
}

export default NavbarComponent;
